//定义cache_server支持的协议#ifndef _DB_PROTOCAL_H#define _DB_PROTOCAL_H#include "global_table.h"#include "wpacket.h"#include "rpacket.h"enum{	CACHE_GET = 0,	CACHE_SET,	CACHE_DEL,};struct cache_protocal{	wpacket_t (*execute)(global_table_t,rpacket_t,uint32_t);};typedef struct cache_protocal* cache_protocal_t;cache_protocal_t create_get();cache_protocal_t create_set();cache_protocal_t create_del();void             destroy_protocal(cache_protocal_t*);#endif